<form (submit)="onSubmit()">
    <div class="mb-3">
      <label class="form-label" name="Nname" [(ngModel)]="nick_name">Usuario</label>
      <input type="text" class="form-control"  aria-describedby="emailHelp" name="Nname" [(ngModel)]="nick_name">
    </div>
    <div class="mb-3">
      <label class="form-label" name="description" [(ngModel)]="description">Contraseña</label>
      <input type="text" class="form-control" name="description" [(ngModel)]="description">
    </div>
    <button type="submit" class="btn btn-primary">Agregar</button>
  </form>

